script: |
  super -f text -I q1371.spq | sort > q1371.out

inputs:
  - name: q1371.spq
    data: |
      SELECT ALL + - col0 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col0 + col1 * - col1 NOT IN ( ( + col0 ), + col0, + 66 * 45 + col1 );
  - name: tab0

outputs:
  - name: q1371.out
    data: |
